1.description:
Ponúkame na prenájom jedinečný 5 izbový rodinný dom s úžasnou atmosférou a príjemnou záhradou v Devínskej novej vsi na ulici Mlynská.

Prízemie s rozlohou 97m2 pozostáva zo zádveria so vstavanou skriňou, kuchyne s jedálenským kútom, WC a kúpeľne so sprchovacím kútom, jednej obývacej izby s kozubom, jednej ďalšej izby s možnosťou využitia ako pracovne alebo hosťovskej izby a z podschodiskových priestorov na odkladanie vecí. Pri vstupe do domu sa cez veľké presklené posuvné dvere otvára pohľad na dvor s terasou.&nbsp;

Poschodie s rozlohou 97 m2 pozostáva z veľkej spálne so šatníkom, ďalších dvoch izieb&nbsp; a z kúpeľne&nbsp;s vaňou a WC.

Na medziposchodí sa nachádza jedna klimatizačná jednotka.

Dom je podpivničený, miestnosť s rozlohou 55 m2 poskytuje možnosť využitia napr. na fitness.&nbsp;

Na dvore sú okrasné kvety, kríky, jabloň, súvislá trávnatá plocha, prestrešená terasa a prístrešok na drevo. Pod prístreškom je možné zaparkovať bicykle. Súčasťou záhradky je zakopaná zberná nádoba na dažďovú vodu napojená na čerpadlo.&nbsp;

Zastavané plochy a nádvoria majú spolu 220 m2. Dom, ktorý má 20 rokov, má novú modernú kuchyňu a nábytok vyhotovený na mieru. Je na slepej ulici, pred vchodovými dverami je na otvorenom priestranstve možné zaparkovať dve autá.&nbsp;Rodinný dom sa nachádza v uličnej zástavbe rodinných domov, je napojený na verejné rozvody elektrickej energie, kanalizácie, vody, plynu.&nbsp;

NEHNUTEĽNOSŤ JE IDEÁLNA PRE ĽUDÍ PRACUJÚCICH V RAKÚSKU. Cesta z domu na železničnú stanicu trvá päť minút pešo. Po zrekonštruovanej trati budete vo Viedni o polhodinu. Devínska Nová Ves ponúka život v hlavnom meste a súčasne uprostred prírody, v blízkosti rieky Moravy, na úpätí chránenej krajinnej oblasti Devínska Kobyla. Využívate cyklotrasy, turistické chodníky, grilujete v záhradných reštauráciách, kúpete sa v neďalekých prírodných jazerách, jete taliansku zmrzlinu, z vyhliadkovej veže sa pozeráte do troch krajín. Deti aj dospelÍ majú dostatok príležitostí na bohaté športové a kultúrne vyžitie. Devínska je mestská časť so srdcom s bohato rozvinutým komunitným životom.&nbsp;

Cena prenájmu 1700 eur/mesiac + energie.&nbsp;

Bosen Group&nbsp;Vám ponúka na prenájom ešte neobývaný štýlový a plne zariadený 1-izbový klimatizovaný&nbsp;byt v žiadanej lokalite Ovocné sady v Bratislave. Byt sa nachádza na 5.&nbsp;poschodí bytového domu.&nbsp;

3D virtálna prehliadka:&nbsp;https://my.matterport.com/show/?m=bheYKvVjifJ

BYT:&nbsp;Byt má výmeru 31,2m2 + 2,8m2 balkón. Nachádza sa v novostavbe Ovocné sady, na Ivanskej ceste v m.č. Ružinov. K bytu je priradené aj parkovacie státie pred bytovým domom. Byt je klimatizovaný.

DISPOZÍCIA:&nbsp;Byt je veľmi dobre dispozične riešený. Je tam dostatok úložného priestoru.&nbsp;Vstupná chodba so vstavanou skriňou, obývacia časť&nbsp;spojená s kuchyňou, spacou časťou&nbsp;a výstupom na balkón, kúpeľňa spojená s toaletou. &nbsp;

ZARIADENIE:&nbsp;Byt je vybavený nábytkom na mieru, to zabezpečuje dostatok úložného priestoru. V chodbe sa nachádza šatníková skriňa. V obývacej izbe je gauč, stolík pod TV , konferenčný stolík a TV. V kuchyni je umývačka riadu, digestor, mikrovlnná rúra, chladnička s mrazničkou,indukčná varná doska a elektrická rúra. Za obývacou časťou sa nachádza posteľ. V kúpelni je práčka so sušičkou a vaňa s toaletou.&nbsp;

LOKALITA:&nbsp;Ovocné sady sú modernou a vyhľadávanou rezidenčnou lokalitou v Bratislave. Táto dynamicky sa rozvíjajúca oblasť ponúka vynikajúcu infraštruktúru a všetky potrebné služby na dosah. Lokalita má vynikajúcu dostupnosť do centra mesta a na hlavné dopravné tepny. Blízka dostupnosť MHD umožňuje jednoduché cestovanie po celej Bratislave. V tesnej blízkosti nájdete aj nákupné centrá ako Avion, Pharros či Ikea. Vedľa domu je udržiavaný park, s detskými a fittness prvkami, či miesto na&nbsp;grilovanie.

CENA:&nbsp;500&nbsp;EUR nájom/ mesiac + 170 EUR energie/ mesiac + 50 EUR parkovacie státie/ mesiac + 720 EUR depozit + provízia RK

Byt je vhodný pre jednu, maximálne dve osoby a je voľný ihneď. V byte nie je dovolené domáce zviera.

